INSERT INTO roles (role_id, name)
SELECT NewNames.role_id, NewNames.name
FROM (VALUES (1, 'ROLE_ADMIN'), (2, 'ROLE_USER')) AS NewNames (role_id, name)
WHERE NOT EXISTS (SELECT 1 FROM roles);

INSERT INTO users (user_id, first_name, last_name, username, password, email, birthdate, about, is_banned)
SELECT *
FROM (SELECT 0                                                              c1,
             'default'                                                      c2,
             'default'                                                      c3,
             'default'                                                      c4,
             '$2a$10$WY2HlqYnDiPg6CSnERFEDe3bK3AXmEpjcDAnSS1Cllt4mBGOHsoNq' c5,
             'default'                                                      c6,
             TO_DATE('17/12/2015', 'DD/MM/YYYY')                            c7,
             'default'                                                      c8,
             false                                                          c9) t
WHERE NOT EXISTS (SELECT 1 FROM users);


INSERT INTO users_roles (user_id, role_id)
SELECT NewNames.user_id, NewNames.role_id
FROM (VALUES (0, 1)) AS NewNames (user_id, role_id)
WHERE NOT EXISTS (SELECT 1 FROM users_roles);



INSERT INTO articles (article_id, title, content, image, author_id, created, published, likes, status, views)
SELECT Temp.article_id,
       Temp.title,
       Temp.content,
       Temp.image,
       Temp.author_id,
       Temp.created,
       Temp.published,
       Temp.likes,
       Temp.status,
       Temp.views
FROM (VALUES
          /* first article */
          (1,
           'Curiosity Rover Mission Overview',
           'Curiosity set out to answer the question: Did Mars ever have the right environmental conditions to support small life forms called microbes? Early in its mission, Curiosity''s scientific tools found chemical and mineral evidence of past habitable environments on Mars. It continues to explore the rock record from a time when Mars could have been home to microbial life.',
           '',
           0,
           current_timestamp,
           current_timestamp,
           0,
           'PUBLISHED',
           0),


          /*second article*/


          (2,
           'Mars Reconnaissance Orbiter Mission Overview',
           'NASAs Mars Reconnaissance Orbiter blasted off from Cape Canaveral in 2005, on a search for evidence that water persisted on the surface of Mars for a long periods of time. While other Mars missions have shown that water flowed across the surface in Mars'' history, it remains a mystery whether water was ever around long enough to provide a habitat for life.',
           '',
           0,
           current_timestamp,
           current_timestamp,
           0,
           'PUBLISHED',
           0),


          /* third article */


          (3,
           'Odyssey Orbiter Mission Overview',
           'The 2001 Mars Odyssey mission is NASA''s longest-lasting spacecraft at Mars. The spacecraft launched on April 7, 2001, and arrived at Mars on October 24, 2001, 0230 Universal Time (October 23, 7:30 pm PDT/ 10:30 EDT). Its mission includes making the first global map of the amount and distribution of many chemical elements and minerals that make up the Martian surface. It successfully completed its primary science mission from February 2002 through August 2004. The orbiter''s extended operations continue today.',
           '',
           0,
           current_timestamp,
           current_timestamp,
           0,
           'PUBLISHED',
           0))
         AS Temp (article_id, title, content, image,
                  author_id, created, published, likes,
                  status, views)
WHERE NOT EXISTS (SELECT 1 FROM articles);